import React from 'react';
import MemorialContainer from './components/MemorialContainer';
import ParticleCanvas from './components/ParticleCanvas';
import CustomCursor from './components/CustomCursor';
import './styles.css';

const App = () => {
  return (
    <>
      <ParticleCanvas />
      <CustomCursor />
      <MemorialContainer />
    </>
  );
};

export default App;
